import React, { Component } from 'react'

export default class About extends Component {
	render() {
		return (
			<main>
				<section className='About'>
					<header className='About_header'>
						<h1 className='About_h1'>Обо мне</h1>
					</header>
          <div className='About_info'>
            <p className='About_name'>Я Кузьма, мне 15 лет. Занимаюсь программированием чуть больше года(с ) </p>
          </div>
				</section>
			</main>
		)
	}
}
